import Cadastrar from "./Cadastrar"
import {Switch, Route} from 'react-router-dom';
import Home from "./pages/home/Home";

export default () => {
    return(
        <Switch>
            <Route path='/'>
                <Home></Home>
            </Route>

            <Route exec path="/cadastrar">
                <Cadastrar></Cadastrar>
            </Route>
        </Switch>
    )
}
